            :root {
                --font-default: "Author", sans-serif;
                --colorLinks: black;
                /* misc */
                --colorGray: #808080;
                --colorWhite: black;
            }

            body {
                font-family: var(--font-default);
                font-size: 16px;
                display: flex;
                flex-direction: column;
                justify-content: center;
                align-items: stretch;
                padding: 17px;
                background-color: white;
                color: black;
                -webkit-font-smoothing: subpixel-antialiased;
                -moz-osx-font-smoothing: grayscale;
                text-rendering: optimizeLegibility;
                backface-visibility: hidden;
            }

            html,
            body {
                height: 100vh;
            }

            * {
                margin: 0;
                padding: 0;
                box-sizing: border-box;
            }

            .logo {
                background-image: radial-gradient(circle at 100% 0%, #ef656e, #ec77ac 100%), linear-gradient(to bottom, #fff, #fff);
                line-height: 1;
                font-size: 40px;
                font-weight: 400;
                -webkit-background-clip: text;
                -webkit-text-fill-color: transparent;
            }

            #container {
                position: absolute;
                margin: 50px;
                flex-grow: 0;
                display: flex;
                flex-direction: column;
                justify-content: center;
                align-items: center;
                gap: 10px;
                padding: 24px;
                border-radius: 8px;
                -webkit-backdrop-filter: blur(10px);
                backdrop-filter: blur(10px);
                box-shadow: inset 0 1px 1px 0 rgba(255, 255, 255, 0.25), inset 0 -1px 1px 0 rgba(255, 255, 255, 0.1),
                    0 32px 40px 0 rgba(0, 0, 0, 0.24);
                background-color: white;
            }

            #top,
            #top * {
                display: flex;
                flex-direction: column;
                justify-content: center;
                align-items: center;
            }

            #top img {
                width: 54px;
                margin-right: 12px;
            }

            #top span {
                font-size: 42px;
                font-weight: 300;
            }

            #bottom p {
                text-align: center;
                font-size: 18px;
            }

            #bottom p span {
                font-size: 16px;
            }

            #bottom span.big {
                font-size: 20px;
                font-weight: normal;
            }

            #linkBtns {
                margin-top: 22px;
                text-align: center;
            }

            #timer {
                margin-top: 10px;
                text-align: center;
            }

            #bg {
                position: relative;
                height: 100%;
                width: 100%;
                display: flex;
                flex-direction: column;
                /* justify-content: flex-start; */
                /* align-items: flex-end; */
                justify-content: center;
                align-items: center;
                border-radius: 16px;
            }

            #gradient {
                width: 100%;
                height: 100%;
                top: 0;
                left: 0;
                position: absolute;
                border-radius: 16px;
                background: #0006 linear-gradient(180deg, transparent 0%, #3d1f2c00 80%);
            }

            @media screen and (max-width: 640px) {
                #bg {
                    position: relative;
                    align-items: center;
                    border-radius: 16px;
                }

                #container {
                    margin: 8px;
                }

                #top span {
                    font-size: 38px;
                }

                #top img {
                    width: 46px;
                    margin-right: 6px;
                }
            }

            /* links */
            a {
                color: var(--colorLinks);
                text-decoration: underline;
            }

            a:hover {
                color: #24b7b7;
                text-decoration: underline;
            }

            img#kong {
                width: 100%;
                height: 100%;
                border-radius: 16px;
                background-size: cover;
                background-position: center;
                object-fit: cover;
                display: block;
            }

            /* Scrollbar - Default (Not Vue) */
            /* Common styles for Chrome, Safari, Edge */
            ::-webkit-scrollbar {
                width: 0px;
            }

            ::-webkit-scrollbar-thumb {
                background-clip: padding-box;
            }

            ::-webkit-scrollbar-thumb:hover {
                background-color: #bbbbbb;
            }

            /* Firefox WOW */
            * {
                scrollbar-width: none;
                scrollbar-color: var(--colorWhite) transparent;
            }
        </style>
        <script type="text/javascript">
            const refresh = () => {
                clearInterval(window.refreshI);
                window.location.href = "https://theaceae.org";
            };
            const images = [
                "images/saj.png",
                "images/everthink.png",
                "images/waffle.png",
                "images/mario.gif",
                "images/ahhh-turtle.gif",
                "images/porter-moggingson.gif",
                "images/porter-robinson-porter.gif",
            ];

            let lastIndex = -1;
            function getRandomImage() {
                let randomIndex;
                do {
                    randomIndex = Math.floor(Math.random() * images.length);
                } while (randomIndex === lastIndex);

                document.getElementById("kong").src = images[randomIndex];
                lastIndex = randomIndex;
            }

            window.onload = () => {
                getRandomImage();

                let el = document.getElementById("attemptTime");
                let elP = document.getElementById("attemptTimeParent");
                let updateEl = (d) => {
                    if (!el) return;
                    if (elP) elP.style = "";
                    el.innerText = d;
                };

                window.refreshTime = 5;
                updateEl(`${window.refreshTime} second${window.refreshTime == 1 ? "" : "s"}.`);
                window.refreshI = setInterval(() => {
                    if (window.refreshTime <= 0) {
                        updateEl("progress!");
                        setTimeout(refresh, 500);
                        return;
                    }
                    window.refreshTime--;
                    updateEl(`${window.refreshTime} second${window.refreshTime == 1 ? "" : "s"}.`);
                }, 1000);
            };
        </script>
    </head>
